import React from 'react';

const App = () => {
  return (
    <div>
      <header>
        <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/LEGO_logo.svg/768px-LEGO_logo.svg.png" />
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
      </nav>
      <div>Main content</div>
    </div>
  );
};

export default App;
